import React from 'react';
import './ThoughtsBacklog.css';

const ThoughtsBacklog = () => {
  return (
    <div className="backlog-container">
      <h1 className="backlog-title">Your Thoughts Backlog</h1>
      <div className="thoughts-list">
        <div className="thought">Thought 1</div>
        <div className="thought">Thought 2</div>
        <div className="thought">Thought 3</div>
      </div>
    </div>
  );
};

export default ThoughtsBacklog;
